import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import HomeIcon from '@mui/icons-material/Home';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MoreIcon from '@mui/icons-material/MoreVert';

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: 'transparent',
  boxShadow: 'none',
  borderTop: '1px solid #ccc',
  position: 'fixed',
  width: '100%',
  overflow: 'visible',
  height: '80px', // Ajusta la altura de la barra de aplicación según sea necesario
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'flex-start', // Alinea los elementos en la parte superior de la barra
  width: '100%',
  padding: '0 16px',
});

const PartiallyVisibleIconButton = styled(IconButton)({
  borderRadius: '50%',
  backgroundColor: '#ecf3f3',
  '&:hover': {
    backgroundColor: '#b0c4c4',
  },
  position: 'relative',
  zIndex: 1,
});

const HomeIconButton = styled(PartiallyVisibleIconButton)({
  '&::before': {
    content: '""',
    position: 'absolute',
    top: '20px', // Ajusta la posición vertical según sea necesario
    left: '50%',
    transform: 'translateX(50%)',
    width: '60%', // Ajusta el ancho de la parte visible del botón Home
    height: '60%', // Ajusta la altura de la parte visible del botón Home
    background: '#800000', // Color del fondo de la parte visible del botón Home
    borderRadius: '50%',
    zIndex: -1,
  },
});

export default function BottomAppBar() {
  return (
    <StyledAppBar>
      <Toolbar>
        <CenteredBox>
          <IconButton size="large" edge="start" color="#ecf3f3" aria-label="open drawer">
            <MoreIcon />
          </IconButton>
          <HomeIconButton size="large" color="#ecf3f3" aria-label="home" style={{ marginLeft: '0px', marginTop: '0px' }}>
            <HomeIcon />
          </HomeIconButton>
          <IconButton size="large" edge="end" color="#ecf3f3" aria-label="account">
            <AccountCircleIcon />
          </IconButton>
        </CenteredBox>
      </Toolbar>
    </StyledAppBar>
  );
}
